import {Route} from 'wouter'
import {Redirect} from "wouter";
export default function AuthenticatedRoute({ component: C, appProps, ...rest }) {
    return (
        <Route
            {...rest}
            render={props =>
                appProps.isLogged
                    ? <C {...props}/>
                    : <Redirect
                        to="/"
                    />}
        />
    );
}
